tests.code:
const notificationData = {
  customer_id: '12345',
  message: 'Votre retour a été traité',
  type: 'return_status'
};
basePage.makeApiRequest('POST', '/api/notifications', notificationData).then(response => {
  expect(response.status).to.be.oneOf([200, 201, 400, 422, 404]);
  cy.log('Statut API Notifications: ' + response.status);
});

const performanceEndpoints = ['/api/returns', '/api/orders', '/api/tracking'];
performanceEndpoints.forEach(endpoint => {
  basePage.makeApiRequest('GET', endpoint).then(response => {
    expect(response.duration).to.be.lessThan(2000);
    cy.log(`Performance ${endpoint}: ${response.duration}ms`);
  });
});

const invalidEndpoints = ['/api/returns?param=invalid', '/api/orders?id=abc', '/api/tracking?tracking_id='];
invalidEndpoints.forEach(endpoint => {
  basePage.makeApiRequest('GET', endpoint).then(response => {
    expect(response.status).to.be.oneOf([400, 422, 404]);
    cy.log(`Validation ${endpoint}: ${response.status}`);
  });
});

